// define a function that takes an array of numbers as input and returns the maximum sum of any contiguous subarray
function f_gold(nums) {
    var f = nums[0]; // initialize f to the first element of the input array
    var res = f; // initialize res to f
    for (var num of nums.slice(1)) { // loop through the remaining elements of the input array
        f = num + Math.max(f, 0); // update f to be the sum of the current element and the maximum of f and 0
        res = Math.max(res, f); // update res to be the maximum of res and f
    }
    return res; // return the maximum sum of any contiguous subarray
}
